import React from "react";
import "./Gd.css";

function Gd() {
  return (
    <div className="sec9-container">
      <div className="sec9-head">background: #262646;</div>
      <div className="sec9-head2">
        We are a design company that emotes and innovates.
      </div>
      <div className="sec9-para">
        We take responsibility to increase your business tremendously with
        <br />
        technological advantage and support you to stand out uniquely and
        <br />
        consistently in the market.
      </div>
      <div className="sec9-icon"></div>
    </div>
  );
}

export default Gd;
